import { PostType, Posts } from "../lib/types";
import { Post as ViewPost } from "./Post";
export function Container(props: {posts: Posts}) {
  return (
    <div>
      <ul style={{ listStyle: "none" }}>
        {props.posts.map((post) => (
          <li key={post.id}>
            <ViewPost id={post.id} body={post.body} title={post.title} />
          </li>
        ))}
      </ul>
      <pre>{JSON.stringify(props.posts)}</pre>
    </div>
  );
}
